import { useState } from 'react';
import {setEventName} from './Profile';
function AddEvent(props) {
    const setActive = props.setActive; 
    const setEventName = props.setEventName;
    const setNumberOfMembers = props.setNumberOfMembers;
    const setStartDate = props.setNumberOfMembers;
    const setEndDate = props.setEndDate;
    const setHours = props.setHours;
    
    return (
        <>
            <h2>Add an event!</h2>
            <form>
                <label>
                    Name of event:
                    <input type = 'text' onChange={(e) => setEventName(e)} />
                </label>
                <label>
                    Total number of members:
                    <input type = 'number' onChange={(e) => setNumberOfMembers(e)}/>
                </label>
                <label>
                    Start Date:
                    <input type = 'date' onChange={(e) => setStartDate(e)}/>
                </label>
                <label>
                    End Date:
                    <input type = 'date' onChange={(e) => setEndDate(e)}/>
                </label>
                <label>
                    Total hours per slot:
                    <input type = 'number' onChange={(e) => setHours(e)}/>
                </label>
            </form>
            <div>
                <button onClick = {() => setActive("Profile")}> Return to your profile</button>
            </div>
            
        </>
    )
}
export default AddEvent;
